window.bookSummaryJSON = "<p><b>War has come to the massive multiplayer online role-playing game known as </b><b><i>Another Online</i></b><b>.</b></p> <p>Var now faces enemies on all sides. The Alliance wants to destroy her empire. The Game Masters treat her and those like her as puppets. The Clockwork Princess will stop at nothing to kill her. Even her allies seem to have their own motives and squabbles. And above it all, the ever watchful eye of the System Hivemind rules <i>AO</i> by pain and fear. Some wish to control, some wish to destroy, where she looks to find a way to free herself and all those enslaved in<i> Another Online</i>.</p> <p><b>Every choice she makes will shape </b><b><i>Another Online</i></b><b> into something new, but what will this new world become?</b></p>"; 
